/**
 * Different navigation modes for ItemNavigation.
 *
 * @public
 */
enum NavigationMode {
	/**
	 * @public
	 */
	Auto = "Auto",
	/**
	 * @public
	 */
	Vertical = "Vertical",
	/**
	 * @public
	 */
	Horizontal = "Horizontal",
	/**
	 * @public
	 */
	Paging = "Paging",
}

export default NavigationMode;
